import React from "react"
import { Modal, Div, Container, Icon, Button, Text, Input, Row, Col, Image, Anchor } from "atomize";

function SearchResults({isOpen, onClose, props}) {

  return(
    <Modal isOpen={isOpen} onClose={onClose} bg="danger800" align="center" rounded="sm" h="36rem" maxW="72rem">
      <Row d="flex" h="1120px" w="299px">
        <Col>
          <Anchor>
            <Image maxH="233px" w="166">
              {props.APIData.map((item, i) => {return(item.title)})}
            </Image>
            <Text>
              {props.APIData.map((item, i) => {return(item.title)})}
            </Text>
          </Anchor>
        </Col>
      </Row>
      </Modal>
  )
}

export default SearchResults;
